INSERT INTO `laminas` VALUES (1,'4610','sd',NULL,NULL,NULL,'2018-11-21 13:51:27','2018-11-21 15:01:09','2018-11-21 15:01:09'),(2,'GOLDEN PARK RIO DE JANEIRO Cod: 3790','Reserve 04 diárias ou mais e Ganhe 01 diária. Promoção válida até 31/05/2019 para reservas com check-in aos Domingos e check-out nas quintas-feiras.','​Ficamos no aguardo de seu retorno, assim como, nos colocamos à disposição para o que se faça necessário.',NULL,NULL,'2018-11-21 15:01:05','2018-11-21 15:01:05',NULL),(3,'ROYALTY BARRA HOTEL Cod: 4610','O hotel está disponível promocionalmente, sem cobrança de diferença de categoria, para reservas de usuários Gold. Promoção válida para reservas com check-out até 20/12/2019.','asd',NULL,NULL,'2018-11-21 15:01:30','2018-11-21 15:06:57',NULL),(4,'BOURBON BARRA PREMIUM RESIDENCE Cod: 4761','Reserve 04 diárias ou mais e Ganhe¹ 01 diária + 01 CHD² Free até 10 anos. ¹Promoção válida para reservas com check-in a partir de 01/12/2018 e com check-out até 27/12/2018. ²Promoção válida para reservas efetuadas no período de 14/11/2018 a 27/12/2018 para check-in a partir de 01/03/2019 e com check-out até 31/05/2019.  A criança será acomodada em cama existente no mesmo apartamento dos pais/responsáveis. É obrigatória a informação da criança na confirmação da reserva (voucher). Limitada para 2 adultos pagantes (apto duplo).','asdf',NULL,NULL,'2018-11-21 15:04:46','2018-11-21 15:07:12',NULL);

